        ctx.font = 'bold '+ this.font_size + 'pt Arial';
        ctx.strokeStyle = '#844614';
        ctx.miterLimit = 2;
        ctx.lineJoin = "round";
        ctx.lineWidth = 3;
        ctx.strokeText(this.Power + " w",this.col_img_x + posx,this.col_img_y + posy);
        ctx.lineWidth = 1;
        ctx.fillStyle = '#cd2400'; 
        ctx.fillText(this.Power + " w",this.col_img_x + posx,this.col_img_y + posy);

        //cinienie
