        ctx.lineWidth = 1;
        ctx.fillStyle = '#cd2400'; 
        ctx.fillText(this.PresureBMP + " pa",this.col_img_x + posx,this.col_img_y + posy);


        //bufor
        posx = 600 * this.col_img_scale;
